import { Route, Routes } from 'react-router-dom';
import React from 'react';
import MainFeed from './components/MainFeed';
import Login from './components/Login';
import Join from './components/Join';
import Member from './components/Member';
import MyFeed from './components/MyFeed';
import Image from './components/Image';
import Calendar from './components/Calendar';
import Board from './components/Board';
import Map from './components/Map';

const App = () => {
  return (
    <Route>
      <Routes index element={<Login />} />
      <Routes path="/join" element={<Join />} />
      <Routes path="/member" element={<Member />} />
      <Routes path="/mainFeed" element={<MainFeed />} />
      <Routes path="/myFeed" element={<MyFeed />} />
      <Routes path="/image" element={<Image />} />
      <Routes path="/calendar" element={<Calendar />} />
      <Routes path="board" element={<Board />} />
      <Routes path="map" element={<Map />} />
    </Route>
  );
};

export default App;
